import { Navbar } from 'react-bootstrap';
import { NavDropdown } from 'react-bootstrap';
import { Container } from 'react-bootstrap';
import { Modal } from 'react-bootstrap';
import { useState } from 'react';
import {motion} from 'framer-motion'





export const Skills = (props) => {




return (
<div>   
<motion.h1 className='Skills-txt'  animate={{ }}>I have had the chance to work with the following Technologies and gain experience in them :</motion.h1>
<motion.h2 className='Skills-txt'  animate={{ }}> You can also see some code i have written in all of these technologies :</motion.h2><br></br>

<div
className='skill-div'
>

<Row>

<h1 className='skill-head' >Python :</h1>   


<p className='skills'> The first ever language i learned and i have 2+ years of experience using python.</p>


<Col>
<li ><a href='https://github.com/'><motion.img whileHover={{scale : 1.3}} className='Git' src='data:image/png;base64,' height={50} width={50} /></a></li>
</Col>

</Row>
</div>


<p className='skills'>Java :</p>
<p className='skills'>C/C++ :</p>
<p className='skills'>React :</p>
<p className='skills'>Docker :</p>




</div>                  
);


}
